const MoreDetails = ({ nextStep, preStep, handleChange, values}) => {

    let cont = (e) => {
        e.preventDefault();
       return nextStep()
    } 
    let back = (e) => {
        e.preventDefault();
        return preStep()
    }
    return (
            <form className="form">
                <h2>More Details</h2>
               <input 
               type="number" 
               placeholder="Phone no"
               required
               name="phone"
               onChange={handleChange}
               value={values.phone}
               />
                <input 
               type="text" 
               placeholder="Occupation"
               required
               value={values.occupation}
               onChange={handleChange}
               name="occupation"
               />
                <input 
               type="text" 
               placeholder="Your City"
               required
               value={values.city}
               onChange={handleChange}
               name="city"
               />
                  <input 
               type="text" 
               placeholder="Your Bio"
               required
               value={values.bio}
               onChange={handleChange}
               name="bio"
               />
             
             <div className="btn-grp">
               <button 
               onClick={cont}
               className='cont-btn'
               >
                   continue
                </button>
                <button 
               onClick={back}
               className='back-btn'
               >
                   Back
                </button>

                </div>
            </form>
     );
}
 
export default MoreDetails;
